import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Paper } from "@mui/material";
import { Divider } from "@material-ui/core";
import Button from "@mui/material/Button";
import DescriptionIcon from "@mui/icons-material/Description";

export default function Resume() {
  return (
    // <Paper style={{ height: "100vh" }}>
    <div style={{ paddingLeft: "15%", margin: "auto" }}>
      <div
        className="justify-content-center mt-5"
        style={{
          boxShadow:
            "rgba(0, 0, 0, 0.25) 0px 54px 55px, rgba(0, 0, 0, 0.12) 0px -12px 30px, rgba(0, 0, 0, 0.12) 0px 4px 6px, rgba(0, 0, 0, 0.17) 0px 12px 13px, rgba(0, 0, 0, 0.09) 0px -3px 5px",
        }}
      >
        <a href="../Images/CV.jpg" download style={{ textDecoration: "none" }}>
          <Button
            style={{ marginRight: "2%", backgroundColor: "#00b386" }}
            variant="contained"
            startIcon={<DescriptionIcon />}
          >
            <b> Download PDF Version</b>
          </Button>
        </a>
        <Divider className="mt-5 mb-4" style={{ color: "white" }} />
        <img
          src="../Images/CV.jpg"
          style={{
            width: "42%",
          }}
        />
      </div>
    </div>
    // </Paper>
  );
}
